    def criar_linha_busca(self, i=int):
        texto = str(self.barra_de_busca.toPlainText())
        texto = texto.lower()
        texto = texto.split()

        for palavra in texto:
            for produto in self.produtos_no_banco:
                indice = produto.index()
                for palavra_ex in produto:
                    palavra_ex = palavra_ex.lower()
                    if palavra == palavra_ex:
                        id = str(self.produtos_no_banco_id[indice])

                        consulta_nome = """SELECT Nome FROM tbl_Produtos WHERE ID_Produto = '{}'""".format(id)
                        consulta_marca = """SELECT Marca FROM tbl_Produtos WHERE ID_Produto = '{}'""".format(id)

                        cursor.execute(consulta_nome)
                        resultado_nome = cursor.fetchall()[0][0]

                        cursor.execute(consulta_marca)
                        resultado_marca = cursor.fetchall()[0][0]

                        _translate = QtCore.QCoreApplication.translate
                        nome_item=resultado_nome
                        self.nome_item = QtWidgets.QLabel(self.gridLayoutWidget)
                        font = QtGui.QFont()
                        font.setPointSize(12)
                        self.nome_item.setFont(font)
                        self.layout_corpo.addWidget(self.nome_item, i, 0, 1, 1)
                        setattr(self, f'nome{id}', self.nome_item)
                        self.nome_item.setObjectName('nome'+id)
                        self.nome_item.setText(_translate("MainWindow", nome_item))

                        marca_item=resultado_marca
                        self.marca_item = QtWidgets.QLabel(self.gridLayoutWidget)
                        font = QtGui.QFont()
                        font.setPointSize(12)
                        self.marca_item.setFont(font)
                        self.layout_corpo.addWidget(self.marca_item, i, 1, 1, 1)
                        self.marca_item.setAlignment(QtCore.Qt.AlignCenter)
                        setattr(self, f'marca{id}', self.marca_item)
                        self.marca_item.setObjectName('marca'+id)
                        self.marca_item.setText(_translate("MainWindow", marca_item))

                        localizar='Localizar'
                        self.localizar = QtWidgets.QPushButton(self.gridLayoutWidget)
                        font = QtGui.QFont()
                        font.setPointSize(12)
                        self.localizar.setFont(font)
                        self.layout_corpo.addWidget(self.localizar, i, 3, 1, 1)
                        self.localizar.setCheckable(True)
                        self.localizar.setAutoExclusive(True)
                        setattr(self, f'localizar{id}', self.localizar)
                        self.localizar.setObjectName(localizar+id)
                        self.localizar.setText(_translate("MainWindow", "Localizar"))

                        nome_botao = str(self.localizar.objectName())
                        self.localizar.clicked.connect(lambda: self.show_mapa_mercado(nome_botao))

    def show_mapa_mercado(self, nome_botao):

        id = int(re.sub(r'[^0-9]', '', nome_botao))

        consulta_corredor = """SELECT Loc_Corredor FROM tbl_Produtos WHERE ID_Produto = '{}'""".format(id)
        consulta_secao = """SELECT Loc_Secao FROM tbl_Produtos WHERE ID_Produto = '{}'""".format(id)

        cursor.execute(consulta_corredor)
        loc_corredor = cursor.fetchall()[0][0]

        cursor.execute(consulta_secao)
        loc_secao = cursor.fetchall()[0][0]

        if loc_corredor == '1':
            if loc_secao == '1':
                self.mapa_do_mercado_ui.indicador.setGeometry(QtCore.QRect(90, 300, 10, 51))
